<!doctype html>
<html lang="ru">
<head>
<meta charset="utf-8">
<meta name="viewport" content="width=device-width, initial-scale=1">
<title>Каталог</title>
<style>
:root{--bg:#0b0d12;--card:#121622;--line:rgba(255,255,255,.10);--muted:rgba(255,255,255,.65);--chip:rgba(255,255,255,.06);--radius:14px}
*{box-sizing:border-box}
body{margin:0;background:var(--bg);color:#fff;font-family:system-ui,-apple-system,Segoe UI,Roboto,Arial,sans-serif}
header{position:sticky;top:0;z-index:10;background:rgba(11,13,18,.92);backdrop-filter:blur(10px);border-bottom:1px solid var(--line)}
.wrap{max-width:1320px;margin:0 auto;padding:16px}
h1{margin:0;font-size:18px}
.sub{margin-top:6px;color:var(--muted);font-size:13px}
.grid{display:grid;grid-template-columns:360px 1fr;gap:16px;align-items:start}
@media (max-width:980px){.grid{grid-template-columns:1fr}}
.panel{background:var(--card);border:1px solid var(--line);border-radius:var(--radius);padding:14px}
label{display:block;margin:10px 0 6px;color:var(--muted);font-size:12px}
input[type="text"],input[type="number"],select{width:100%;padding:10px 12px;border-radius:12px;border:1px solid var(--line);background:#0f1320;color:#fff;outline:none}
.row{display:flex;gap:10px}
.row>div{flex:1}
.btnrow{display:flex;gap:10px;margin-top:12px}
button{flex:1;padding:10px 12px;border-radius:12px;border:1px solid var(--line);background:#0f1320;color:#fff;cursor:pointer}
button:hover{background:#141a2a}
.stats{display:flex;justify-content:space-between;margin-top:10px;color:var(--muted);font-size:12px}
.cards{display:grid;grid-template-columns:repeat(3,minmax(0,1fr));gap:14px}
@media (max-width:1100px){.cards{grid-template-columns:repeat(2,minmax(0,1fr))}}
@media (max-width:620px){.cards{grid-template-columns:1fr}}
.card{background:var(--card);border:1px solid var(--line);border-radius:var(--radius);overflow:hidden}
.cardbtn{cursor:pointer}
.img{height:180px;background:#0f1320;display:flex;align-items:center;justify-content:center}
.img img{width:100%;height:100%;object-fit:cover;display:block}
.noimg{color:var(--muted);font-size:12px}
.body{padding:12px}
.title{margin:0 0 8px;font-size:14px;line-height:1.25}
.meta{display:flex;flex-wrap:wrap;gap:8px}
.chip{border:1px solid var(--line);background:var(--chip);border-radius:999px;padding:6px 10px;font-size:12px;color:var(--muted)}
.desc{margin-top:10px;color:var(--muted);font-size:12px;line-height:1.35;display:-webkit-box;-webkit-line-clamp:3;-webkit-box-orient:vertical;overflow:hidden}
.empty{padding:18px;text-align:center;color:var(--muted);border:1px dashed var(--line);border-radius:var(--radius)}
hr{border:none;border-top:1px solid var(--line);margin:12px 0}
/* modal */
#ov{display:none;position:fixed;inset:0;background:rgba(0,0,0,.65);z-index:9999;padding:18px;overflow:auto}
#modal{max-width:1040px;margin:40px auto;background:var(--card);border:1px solid var(--line);border-radius:var(--radius);overflow:hidden}
#mtop{display:flex;justify-content:space-between;align-items:center;gap:12px;padding:14px;border-bottom:1px solid var(--line)}
#close{padding:10px 12px;border-radius:12px;border:1px solid var(--line);background:#0f1320;color:#fff;cursor:pointer}
#mgrid{display:grid;grid-template-columns:1.2fr 1fr}
@media (max-width:900px){#mgrid{grid-template-columns:1fr}}
#mimgwrap{background:#0f1320;display:flex;align-items:center;justify-content:center;min-height:260px}
#mimg{max-height:520px;width:100%;object-fit:contain;display:none}
#mnoimg{color:var(--muted);font-size:12px;padding:24px}
#mright{padding:14px}
.linkbtn{display:inline-block;margin-top:12px;padding:10px 12px;border-radius:12px;border:1px solid var(--line);background:#0f1320;color:#fff;text-decoration:none}
.linkbtn:hover{background:#141a2a}
.small{font-size:11px;color:var(--muted)}
.variantbar{margin-top:12px}
.vlist{display:flex;gap:8px;flex-wrap:wrap;margin-top:8px}
.vbtn{display:flex;align-items:center;gap:8px;border:1px solid var(--line);background:#0f1320;color:#fff;border-radius:999px;padding:6px 10px;cursor:pointer}
.vbtn:hover{background:#141a2a}
.vthumb{width:28px;height:28px;border-radius:999px;overflow:hidden;background:#111}
.vthumb img{width:100%;height:100%;object-fit:cover;display:block}
.vactive{outline:2px solid rgba(37,99,235,.8)}
</style>
</head>
<body>
<header><div class="wrap">
  <h1>Каталог</h1>
  <div class="sub">Позиции: 787. Фильтры: категория + цена/размеры цифрами + доп. фильтры по категории. Мульти-объявления — по «Название мультиобъявления».</div>
</div></header>

<div class="wrap grid">
  <aside class="panel">
    <label>Поиск</label>
    <input id="q" type="text" placeholder="Например: шкаф, диван, кровать…">

    <label>Категория мебели</label>
    <select id="cat"></select>

    <hr>

    <label>Цена, ₽</label>
    <div class="row">
      <div><input id="pmin" type="number" inputmode="numeric" placeholder="От"></div>
      <div><input id="pmax" type="number" inputmode="numeric" placeholder="До"></div>
    </div>

    <label>Размеры, см (Ш × В × Г)</label>
    <div class="row">
      <div><input id="wmin" type="number" inputmode="numeric" placeholder="Ш от"></div>
      <div><input id="wmax" type="number" inputmode="numeric" placeholder="Ш до"></div>
    </div>
    <div class="row" style="margin-top:10px">
      <div><input id="hmin" type="number" inputmode="numeric" placeholder="В от"></div>
      <div><input id="hmax" type="number" inputmode="numeric" placeholder="В до"></div>
    </div>
    <div class="row" style="margin-top:10px">
      <div><input id="dmin" type="number" inputmode="numeric" placeholder="Г от"></div>
      <div><input id="dmax" type="number" inputmode="numeric" placeholder="Г до"></div>
    </div>

    <hr>

    <div id="attrFilters"></div>

    <div class="btnrow">
      <button id="reset">Сбросить</button>
      <button id="onlyWithPhotos">Только с фото</button>
    </div>

    <div class="stats">
      <div>Всего: <span id="total">—</span></div>
      <div>Показано: <span id="shown">—</span></div>
    </div>
  </aside>

  <main>
    <div id="cards" class="cards"></div>
    <div id="empty" class="empty" style="display:none">Ничего не нашлось.</div>
  </main>
</div>

<div id="ov">
  <div id="modal">
    <div id="mtop">
      <div>
        <div id="mTitle" style="font-size:16px;line-height:1.25"></div>
        <div id="mSub" style="margin-top:6px;color:var(--muted);font-size:12px"></div>
      </div>
      <button id="close">Закрыть</button>
    </div>
    <div id="mgrid">
      <div id="mimgwrap">
        <img id="mimg" referrerpolicy="no-referrer" alt="">
        <div id="mnoimg">нет фото</div>
      </div>
      <div id="mright">
        <div id="mMeta" class="meta"></div>
        <div id="mVariants" class="variantbar" style="display:none">
          <div class="small">Варианты мульти-объявления:</div>
          <div id="vList" class="vlist"></div>
        </div>
        <div id="mAttrs" class="meta" style="margin-top:10px"></div>
        <div id="mDesc" style="margin-top:10px;white-space:pre-wrap;line-height:1.5;font-size:13px"></div>
        <div id="mAct"></div>
      </div>
    </div>
  </div>
</div>

<script>

  function decodeBase64Utf8(b64){
    const binStr = atob(b64);
    const bytes = new Uint8Array(binStr.length);
    for (let i=0;i<binStr.length;i++) bytes[i]=binStr.charCodeAt(i);
    return new TextDecoder("utf-8").decode(bytes);
  }
  function esc(s){
    return (s??"").toString()
      .replaceAll("&","&amp;")
      .replaceAll("<","&lt;")
      .replaceAll(">","&gt;")
      .replaceAll('"',"&quot;")
      .replaceAll("'","&#39;");
  }
  function fmt(n){
    if(n===null||n===undefined||Number.isNaN(n)) return "—";
    return Math.round(n).toString().replace(/\B(?=(\d{3})+(?!\d))/g, " ");
  }
  function uniq(arr){
    return Array.from(new Set(arr))
      .filter(x=>x!==null&&x!==undefined&&String(x).trim()!=="")

  }
  function setText(id, v){ const e=document.getElementById(id); if(e) e.textContent=String(v); }

  const items = DB.items || [];
  const schema = DB.schema || {};
  const ranges = DB.ranges || {"price":[0,0],"width":[0,0],"height":[0,0],"depth":[0,0]};

  const baseRoot = (()=>{
    const p = location.pathname;
    const cut = p.endsWith("/") ? p : p.replace(/\/[^\/]*$/, "/");
    return location.origin + cut;
  })();
  function resolveAsset(u){
    if(!u) return "";
    u = u.toString().trim();
    if(!u) return "";
    if(/^https?:\/\//i.test(u)) return u;
    if(u.startsWith("//")) return location.protocol + u;
    u = u.replace(/^\/+/, "");
    return baseRoot + u;
  }

  const groups = new Map();
  items.forEach((it, idx)=>{
    const key = (it.group_key||"").trim();
    if(!key) return;
    if(!groups.has(key)) groups.set(key, []);
    groups.get(key).push(idx);
  });

  const q=document.getElementById("q");
  const cat=document.getElementById("cat");
  const pmin=document.getElementById("pmin");
  const pmax=document.getElementById("pmax");
  const wmin=document.getElementById("wmin");
  const wmax=document.getElementById("wmax");
  const hmin=document.getElementById("hmin");
  const hmax=document.getElementById("hmax");
  const dmin=document.getElementById("dmin");
  const dmax=document.getElementById("dmax");
  const attrBox=document.getElementById("attrFilters");
  const cards=document.getElementById("cards");
  const empty=document.getElementById("empty");

  let onlyPhotos=false;
  document.getElementById("onlyWithPhotos").addEventListener("click", ()=>{

  cat.innerHTML=cats.map(c=>`<option value="${esc(c)}">${esc(c)}</option>`).join("");

  function setRangeInputs(){
    const rP=ranges.price||[0,0];
    pmin.value=rP[0]; pmax.value=rP[1];
    const rW=ranges.width||[0,0];
    const rH=ranges.height||[0,0];
    const rD=ranges.depth||[0,0];
    wmin.value=rW[0]; wmax.value=rW[1];
    hmin.value=rH[0]; hmax.value=rH[1];
    dmin.value=rD[0]; dmax.value=rD[1];
  }
  setRangeInputs();

  function avitoSearchUrl(title){
    const qq = encodeURIComponent((title||"").toString().slice(0,140));
    return `https://www.avito.ru/all?q=${qq}`;
  }

  function buildAttrFilters(category){
    attrBox.innerHTML="";
    const cols = schema[category] || [];
    const catItems = items.filter(x=>x.category===category);

    const norm = (v)=> (v??"").toString().trim().toLowerCase();
    const RULES = {
      "тип шкафов": { hide: true },
      "тип дверей": { allow: new Map([
        ["купе","Купе"],["двери-купе","Купе"],["раздвижные","Купе"],["раздвижной","Купе"],
        ["створчатые","Створчатые"],["створчатый","Створчатые"],["распашные","Створчатые"],["распашной","Створчатые"]
      ])},
      "количество створок": { hideIfSingle: true },
      "форма": { allow: new Map([["прямой","Прямой"],["прямая","Прямой"],["угловой","Угловой"],["угловая","Угловой"]]) },
      "материал": { hideIfSingle: true }
    };

    for(const col of cols){
      const key = norm(col);
      if(RULES[key]?.hide) continue;

      let vals = uniq(catItems.map(it => (it.attrs||{})[col]).filter(v=>v!=null))
        .map(v=>v.toString().trim())
        .filter(v=>v && v!=="-" && v.toLowerCase()!=="нет" && v.toLowerCase()!=="не указано");

      if(vals.length===0) continue;
      if(RULES[key]?.hideIfSingle && vals.length<=1) continue;

      const allowMap = RULES[key]?.allow;
      if(allowMap){
        const mapped=[];
        for(const v of vals){
          const vv=norm(v);
          if(allowMap.has(vv)) mapped.push(allowMap.get(vv));
        }
        vals = uniq(mapped);
        if(vals.length===0) continue;
      }

      if(vals.length>30) continue;

      const safeId = "af_" + col.replace(/[^a-zA-Z0-9а-яА-Я]+/g,"_");
      const wrap=document.createElement("div");
      wrap.innerHTML = `
        <label>${esc(col)}</label>
        <select id="${esc(safeId)}">
          <option value="">Любое</option>
          ${vals.map(v=>`<option value="${esc(v)}">${esc(v)}</option>`).join("")}
        </select>
      `;
      attrBox.appendChild(wrap);
    }

    if(!attrBox.children.length){
      const d=document.createElement("div");
      d.className="small";
      d.style.marginTop="6px";
      d.textContent="Для этой категории нет доп. фильтров (или они скрыты правилами).";
      attrBox.appendChild(d);
    }
  }

  function collectAttrSelections(){
    const sels={};
    attrBox.querySelectorAll("select").forEach(sel=>{
      const label = sel.parentElement.querySelector("label");
      const key = label ? label.textContent : "";
      const v = sel.value;
      if(v) sels[key]=v;
    });
    return sels;
  }

  const ov=document.getElementById("ov");
  const closeBtn=document.getElementById("close");
  const mTitle=document.getElementById("mTitle");
  const mSub=document.getElementById("mSub");
  const mimg=document.getElementById("mimg");
  const mno=document.getElementById("mnoimg");
  const mMeta=document.getElementById("mMeta");
  const mVars=document.getElementById("mVariants");
  const vList=document.getElementById("vList");
  const mAttrs=document.getElementById("mAttrs");
  const mDesc=document.getElementById("mDesc");
  const mAct=document.getElementById("mAct");

  function renderModal(idx){
    const it=items[idx];
    if(!it) return;

    mTitle.textContent = it.title||"";
    const color = it.color ? ` • ${it.color}` : "";
    const multi = it.multi ? ` • мульти: ${it.multi}` : "";
    mSub.textContent = `${it.category||""} • ${it.price!=null ? (fmt(it.price)+" ₽") : "цена —"}${color}${multi}`;

    const photo = (it.photos && it.photos.length) ? resolveAsset(it.photos[0]) : "";
    if(photo){ mimg.src=photo; mimg.style.display="block"; mno.style.display="none"; }
    else { mimg.removeAttribute("src"); mimg.style.display="none"; mno.style.display="block"; }

    const dims = `Ш ${it.width!=null?fmt(it.width):"—"} · В ${it.height!=null?fmt(it.height):"—"} · Г ${it.depth!=null?fmt(it.depth):"—"}`;
    const g = it.group_key && groups.has(it.group_key) ? groups.get(it.group_key) : null;
    const vcount = g ? g.length : 0;

    mMeta.innerHTML = [
      `<span class="chip">Цена: ${fmt(it.price)} ₽</span>`,
      `<span class="chip">${esc(dims)}</span>`,
      vcount>1 ? `<span class="chip">Вариантов: ${vcount}</span>` : ``
    ].filter(Boolean).join("");

    if(g && g.length>1){
      mVars.style.display="block";
      vList.innerHTML = g.map((j)=>{
        const vv=items[j];
        const thumb = (vv.photos && vv.photos.length) ? resolveAsset(vv.photos[0]) : "";
        const label = (vv.color || vv.title || "вариант");
        const cls = (j===idx) ? "vbtn vactive" : "vbtn";
        return `
          <button class="${cls}" data-j="${j}">
            <span class="vthumb">${thumb ? `<img referrerpolicy="no-referrer" src="${esc(thumb)}" alt="">` : ""}</span>
            <span>${esc(label)}</span>
          </button>
        `;
      }).join("");
      vList.querySelectorAll("button").forEach(btn=>{
        btn.addEventListener("click", ()=>{
          const j=parseInt(btn.getAttribute("data-j"),10);
          if(Number.isFinite(j)) renderModal(j);
        });
      });
    } else {
      mVars.style.display="none";
      vList.innerHTML="";
    }

    const attrs = it.attrs || {};
    const pills = Object.keys(attrs).slice(0,34).map(k=>`<span class="chip">${esc(k)}: ${esc(attrs[k])}</span>`).join("");
    mAttrs.innerHTML = pills || `<span class="chip">без доп. параметров</span>`;

    mDesc.textContent = (it.desc||"").toString();

    const url = it.link ? it.link : avitoSearchUrl(it.title);
    mAct.innerHTML = `<a class="linkbtn" href="${esc(url)}" target="_blank" rel="noopener noreferrer">Открыть на Авито</a>`;
  }

  function openModal(idx){ renderModal(idx); ov.style.display="block"; document.body.style.overflow="hidden"; }
  function closeModal(){ ov.style.display="none"; document.body.style.overflow=""; }

  closeBtn.addEventListener("click", closeModal);
  ov.addEventListener("click",(e)=>{ if(e.target===ov) closeModal(); });
  document.addEventListener("keydown",(e)=>{ if(e.key==="Escape" && ov.style.display==="block") closeModal(); });

  function dimPass(v, a, b, fullA, fullB){
    if(a===fullA && b===fullB) return true;
    if(v==null || Number.isNaN(v)) return false;
    return v>=a && v<=b;
  }

  function render(){
    const qq=(q.value||"").trim().toLowerCase();
    const cc=cat.value;

    const pR=ranges.price||[0,0];
    const wR=ranges.width||[0,0];
    const hR=ranges.height||[0,0];
    const dR=ranges.depth||[0,0];

    let pA=readInt(pmin,pR[0]), pB=readInt(pmax,pR[1]); if(pA>pB){const t=pA;pA=pB;pB=t;}
    let wA=readInt(wmin,wR[0]), wB=readInt(wmax,wR[1]); if(wA>wB){const t=wA;wA=wB;wB=t;}
    let hA=readInt(hmin,hR[0]), hB=readInt(hmax,hR[1]); if(hA>hB){const t=hA;hA=hB;hB=t;}
    let dA=readInt(dmin,dR[0]), dB=readInt(dmax,dR[1]); if(dA>dB){const t=dA;dA=dB;dB=t;}

    const attrSel = (cc!=="Все категории") ? collectAttrSelections() : {};

    const current = items.map((it, idx)=>({it, idx})).filter(o=>{
      const it=o.it;
      if(cc!=="Все категории" && it.category!==cc) return false;
      if(onlyPhotos && (!it.photos || it.photos.length===0)) return false;

      const price=it.price;
      if(price==null || Number.isNaN(price) || price<pA || price>pB) return false;

      if(!dimPass(it.width, wA, wB, wR[0], wR[1])) return false;
      if(!dimPass(it.height, hA, hB, hR[0], hR[1])) return false;
      if(!dimPass(it.depth, dA, dB, dR[0], dR[1])) return false;

      if(qq){
        const hay=((it.title||"")+" "+(it.desc||"")+" "+(it.multi||"")).toLowerCase();
        if(!hay.includes(qq)) return false;
      }

      if(cc!=="Все категории"){
        const attrs=it.attrs||{};
        for(const k in attrSel){
          if((attrs[k]||"")!==attrSel[k]) return false;
        }
      }
      return true;
    });

    setText("shown", current.length);

    cards.innerHTML = current.map((o)=>{
      const it=o.it; const idx=o.idx;
      const photo = (it.photos && it.photos.length) ? resolveAsset(it.photos[0]) : "";
      const dims = `Ш ${it.width!=null?fmt(it.width):"—"} · В ${it.height!=null?fmt(it.height):"—"} · Г ${it.depth!=null?fmt(it.depth):"—"}`;
      const g = it.group_key && groups.has(it.group_key) ? groups.get(it.group_key) : null;
      const vcount = g ? g.length : 0;
      return `
      <article class="card cardbtn" data-idx="${idx}">
        <div class="img">
          ${photo ? `<img loading="lazy" referrerpolicy="no-referrer" src="${esc(photo)}" alt="">` : `<div class="noimg">нет фото</div>`}
        </div>
        <div class="body">
          <p class="title">${esc(it.title)}</p>
          <div class="meta">
            <span class="chip">${esc(it.category||"")}</span>
            <span class="chip">${fmt(it.price)} ₽</span>
            <span class="chip">${esc(dims)}</span>
            ${vcount>1 ? `<span class="chip">Вариантов: ${vcount}</span>` : ``}
          </div>
          ${it.desc ? `<div class="desc">${esc(it.desc)}</div>` : ``}
        </div>
      </article>`;
    }).join("");

    empty.style.display = current.length ? "none" : "block";

    document.querySelectorAll(".cardbtn").forEach(el=>{
      el.addEventListener("click", ()=>{
        const idx=parseInt(el.getAttribute("data-idx"),10);
        if(Number.isFinite(idx)) openModal(idx);
      });
    });
  }

  function onCategoryChange(){
    const cc=cat.value;
    if(cc!=="Все категории") buildAttrFilters(cc);
    else attrBox.innerHTML="";
    render();
  }

  document.getElementById("reset").addEventListener("click", ()=>{
    q.value=""; cat.value="Все категории";
    setRangeInputs();
    attrBox.innerHTML="";
    onlyPhotos=false;
    document.getElementById("onlyWithPhotos").textContent="Только с фото";
    render();
  });

  ["input","change"].forEach(evt=>{
    q.addEventListener(evt, render);
    pmin.addEventListener(evt, render); pmax.addEventListener(evt, render);
    wmin.addEventListener(evt, render); wmax.addEventListener(evt, render);
    hmin.addEventListener(evt, render); hmax.addEventListener(evt, render);
    dmin.addEventListener(evt, render); dmax.addEventListener(evt, render);
  });
  cat.addEventListener("change", onCategoryChange);
  attrBox.addEventListener("change", render);

  render();
})();
</script>
</body>
</html>
